import { StatusBar } from 'expo-status-bar';
import { SafeAreaView, StyleSheet, Text, View } from 'react-native';


export default function Deshboard(props) {
  return (
    <SafeAreaView>
    <View style={styles.container}>
      <Text> Tela do Deshboard </Text>
    
    </View>
    </SafeAreaView>
  );
}
